export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{"2Z0bI2AHBF":{data:{id:2536,attributes:{imdbId:"tt0066445",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BOTM3ZDcwOTItYzNjZS00NmY5LWFmNjQtZDdhZmI3ODMyNWJkXkEyXkFqcGdeQXVyMTMxMTY0OTQ@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.1\u002F10"},{Source:"Rotten Tomatoes",Value:"22%"}],item_lang:{data:{id:3199,attributes:{title:"Tell Me That You Love Me, Junie Moon",plot:"Junie Moon's face has been disfigured by ill-gotten burns, and she depends on her wit and her friends, Warren and Arthur, to cope. Yearning for independence, the three leave the hospital and search for a house to live in together. Together they stumble into adventures involving the local fish vendor, nosy neighbors, surreptitious vacations, love, and frustration in finding jobs. They also deal with their own particular medical problems and face subtle prejudices in their community.",slug:"tell-me-that-you-love-me-junie-moon"}}},books:{data:[{id:12194,attributes:{title:a,description:e,thumbnail:f,authors:[b,g],firstBook:true,published:h,publisher:i,subtitle:c}},{id:12195,attributes:{title:a,description:"Junie Moon, Warren, and Arthur meet in the hospital and decide to live together when they leave. Each is coping with a disability with courage, strength, and friendship.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=p6ZBAAAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:j,publisher:"Harvill Secker",subtitle:c}},{id:12196,attributes:{title:a,description:e,thumbnail:f,authors:[b,g],firstBook:d,published:h,publisher:i,subtitle:c}},{id:12197,attributes:{title:a,description:"Upon their discharge from a hospital, a disfigured girl and two young men, one with a neurological disease and the other in a wheelchair, decide to share an apartment.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=JcrLwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:j,publisher:"Aerial",subtitle:c}},{id:12198,attributes:{title:"Outstanding Books for the College Bound",description:"Lists more than 1,000 books selected by school and public librarians and provides a brief annotation and the years it was selected",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pxdPtoyTNXYC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Marjorie Lewis","Young Adult Library Services Association"],firstBook:d,published:"1996-01-01",publisher:"Amer Library Assn",subtitle:"Choices for a Generation"}}]}}},meta:{}}},prerenderedAt:1680940914368}}("Tell Me that You Love Me, Junie Moon","Marjorie Kellogg","",null,"Three young people--Arthur, Warren, and Junie Moon--have each been marked tragically by life. They decide to pool their meager resources and face the world together. This is an off-beat play about off-beat people and their adventures are sad and happy, comic and tragic.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Y40skv0XHLoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","D. D. Brooke","1972-01-01","Dramatic Publishing","1968-01-01"))